import React from 'react';

function Bikes() {
  return (
    <div>
      <h1>Our Bikes</h1>
      <p>Explore the collection of classic AJS & Matchless bikes that our club members own and maintain.</p>
      <ul>
        <li>Matchless G3L</li>
        <li>AJS Model 16</li>
        <li>Matchless G80</li>
      </ul>
    </div>
  );
}

export default Bikes;
